import { __decorate } from "tslib";
import { Component } from '@angular/core';
let UploadTabelasComponent = class UploadTabelasComponent {
    constructor(api) {
        this.api = api;
        this.arquivos = [];
        this.enviando = false;
        this.atualizandoStatus = false;
        this.resultado = '';
        this.existeChavesPendentes = false;
        this.tipoResultado = '';
        this.selecionarArquivo = (file) => {
            this.arquivos = this.arquivos.concat(file);
            return false;
        };
        this.removerArquivo = (file) => {
            this.arquivos.splice(this.arquivos.indexOf(file), 1);
            return false;
        };
    }
    ngOnInit() { }
    async enviarArquivo() {
        this.resultado = '';
        this.enviando = true;
        try {
            const resposta = await this.api.importarCBF(this.arquivos);
            this.resultado = resposta;
            this.tipoResultado = 'success';
        }
        catch (ex) {
        }
        finally {
            this.enviando = false;
            this.arquivos = [];
        }
    }
};
UploadTabelasComponent = __decorate([
    Component({
        selector: 'app-administracao',
        templateUrl: './uploadTabelas.component.html',
        styleUrls: ['./uploadTabelas.component.scss'],
    })
], UploadTabelasComponent);
export { UploadTabelasComponent };
